	'826' => {
		message => q|  <p dir="rtl" class="MsoNormal"><span>للويب جوي </span><span>لغة نماذج قوية مبنية لكي تعطيك اكبر قدر من التحكم في شكل المحتوى الخاص بك.</span></p>  <p dir="rtl" class="MsoNormal"><span>&nbsp;</span></p>  <p dir="rtl" class="MsoNormal"><span>ملاحظات:</span></p>  <p dir="rtl" class="MsoNormal"><span>كلا لغة النموذج ومتغيرات النموذج حساسة للوضع.</span></p>  <p dir="rtl" class="MsoNormal"><span>&nbsp;</span></p>  <p dir="rtl" class="MsoNormal"><strong><span>المتغيرات:</span></strong></p>  <p dir="rtl" class="MsoNormal"><span>المتغيرات هي ابسط تحكمات النموذج. يتم استخدامها لوضع قطع المادة. في الامثة ادناه, ضع في الاعتبار ان كلمات </span><em><span>foo</span></em><span> and <em>bar</em></span><span> تستخدم ك</span><span> </span><span>placeholders</span><span>لاسماء المتغيرات الرئيسية التي ستستخدمها. لا تعتبر هذه جزء من متغيرات النموذج.</span></p>  <p dir="rtl" class="MsoNormal"><span>&nbsp;</span></p>  <p dir="rtl" class="MsoNormal"><span>السياق: </span><span>&lt;tmpl_var foo&gt; or &lt;tmpl_var name=&quot;foo&quot;&gt;</span><span></span></p>  <p dir="rtl" class="MsoNormal"><span>مثال: </span><span>&lt;tmpl_var name&gt;</span><span></span></p>  <p dir="rtl" class="MsoNormal"><span>&nbsp;</span></p>  <p dir="rtl" class="MsoNormal"><strong><span>ترك النص:</span></strong></p>  <p dir="rtl" class="MsoNormal"><span>في بعض الاحيان ستريد ترك النص لكي تجعله امنا للاستخدام في داخل </span><span>XML and HTML tags</span><span> او في جافا سكريبت. يوجد طريقة داخلية لعمل هذا المتغير, باستخدام اختيار </span><span>ESCAPE</span><span> الموجود داخل </span><span>&lt;tmpl_var&gt;</span><span>. </span></p>  <p dir="rtl" class="MsoNormal"><em><span>Javascript safe:</span></em><span> &lt;tmpl_var foo ESCAPE=&quot;JS&quot;&gt; </span></p>  <p dir="rtl" class="MsoNormal"><em><span>XML and HTML safe:</span></em><span> &lt;tmpl_var foo ESCAPE=&quot;HTML&quot;&gt; </span></p>  <p dir="rtl" class="MsoNormal"><strong><span>الشروط: </span></strong></p>  <p dir="rtl" class="MsoNormal"><span>شروط ليست شيئا جديدا للمبرمجين, لكن للمصممين من الممكن ان تكون محيرة في البداية. الشروط هي فقط اسئل صح وخطأ, واذا فكرت فيهم بهذه الطريقة لن تكون هناك أي مشاكل. </span></p>  <p dir="rtl" class="MsoNormal"><em><span>Syntax:</span></em><span> &lt;tmpl_if foo&gt; &lt;tmpl_else&gt; &lt;/tmpl_if&gt;<br /> <em>Syntax:</em> &lt;tmpl_unless foo&gt; &lt;tmpl_else&gt; &lt;/tmpl_unless&gt; <br /> <em>Example:</em> &lt;tmpl_if isTrue&gt; It was true!&lt;tmpl_else&gt; It was false! &lt;/tmpl_if&gt; </span></p>  <p dir="rtl" class="MsoNormal"><span>الصحة أو الخأ تحدد بهذه الشروط: </span></p>  <p dir="rtl" class="MsoNormal"><span>المتغيرات الغير مستخدمة في هذا النموذج خطأ</span></p>  <p dir="rtl" class="MsoNormal"><span>المتغيرات الغير معرفة خطأ</span></p>  <p dir="rtl" class="MsoNormal"><span>المتغيرات الغير مملوءة خطأ</span></p>  <p dir="rtl" class="MsoNormal"><span>المتغيرات المساوية لصفر خطأ</span></p>  <p dir="rtl" class="MsoNormal"><span>كل المتغيرات الاخرى صحيحة</span></p>  <p dir="rtl" class="MsoNormal"><span>&nbsp;</span></p>  <p dir="rtl" class="MsoNormal"><strong><span>الدورات:</span></strong></p>  <p dir="rtl" class="MsoNormal"><span>الدورات تتكرر على قامة من نتائج البيانات لكل مدخل في الدورة. الدورات هي اكثر تعقيدا في الاستخدام من المتغيرات العادية, ولكنها اكثر قوة بكثر. </span></p>  <p dir="rtl" class="MsoNormal"><span>&nbsp;</span></p>  <p dir="rtl" class="MsoNormal"><em><span>Syntax:</span></em><span> &lt;tmpl_loop foo&gt; &lt;/tmpl_loop&gt; <br /> <em>Example:</em> <br /> &lt;tmpl_loop users&gt; <br /> &nbsp; Name: &lt;tmpl_var first_name&gt;&lt;br/&gt;<br /> &lt;/tmpl_loop&gt; </span></p>  <p dir="rtl" class="MsoNormal"><strong><span>شروط الدورة:</span></strong></p>  <p dir="rtl" class="MsoNormal"><span>الدورات تأتي بشروط متغيرات خاصة بها. انها </span><span>__FIRST__, __ODD__, __INNER__, and __LAST__</span><span>. يوجد ايضا متغير عداد دورة, </span><span>__COUNTER__</span><span> وهو يتابع كم مرة تم عمل الدورة. </span></p>  <p dir="rtl" class="MsoNormal"><em><span>Examples:</span></em></p>  <p dir="rtl" class="MsoNormal"><span style="font-size: 10pt; font-family: &quot;Courier New&quot;"><span>&nbsp;&nbsp; </span>&lt;TMPL_LOOP FOO&gt;</span></p>  <p dir="rtl" class="MsoNormal"><span style="font-size: 10pt; font-family: &quot;Courier New&quot;"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>&lt;TMPL_IF __FIRST__&gt;</span></p>  <p dir="rtl" class="MsoNormal"><span style="font-size: 10pt; font-family: &quot;Courier New&quot;"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>This only outputs on the first pass.</span></p>  <p dir="rtl" class="MsoNormal"><span style="font-size: 10pt; font-family: &quot;Courier New&quot;"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>&lt;/TMPL_IF&gt;</span></p>  <p dir="rtl" class="MsoNormal"><span style="font-size: 10pt; font-family: &quot;Courier New&quot;">&nbsp;</span></p>  <p dir="rtl" class="MsoNormal"><span style="font-size: 10pt; font-family: &quot;Courier New&quot;"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>&lt;TMPL_IF __ODD__&gt;</span></p>  <p dir="rtl" class="MsoNormal"><span style="font-size: 10pt; font-family: &quot;Courier New&quot;"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>This outputs every other pass, on the odd passes.</span></p>  <p dir="rtl" class="MsoNormal"><span style="font-size: 10pt; font-family: &quot;Courier New&quot;"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>&lt;/TMPL_IF&gt;</span></p>  <p dir="rtl" class="MsoNormal"><span style="font-size: 10pt; font-family: &quot;Courier New&quot;">&nbsp;</span></p>  <p dir="rtl" class="MsoNormal"><span style="font-size: 10pt; font-family: &quot;Courier New&quot;"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>&lt;TMPL_UNLESS __ODD__&gt;</span></p>  <p dir="rtl" class="MsoNormal"><span style="font-size: 10pt; font-family: &quot;Courier New&quot;"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>This outputs every other pass, on the even passes.</span></p>  <p dir="rtl" class="MsoNormal"><span style="font-size: 10pt; font-family: &quot;Courier New&quot;"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>&lt;/TMPL_UNLESS&gt;</span></p>  <p dir="rtl" class="MsoNormal"><span style="font-size: 10pt; font-family: &quot;Courier New&quot;">&nbsp;</span></p>  <p dir="rtl" class="MsoNormal"><span style="font-size: 10pt; font-family: &quot;Courier New&quot;"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>&lt;TMPL_IF __INNER__&gt;</span></p>  <p dir="rtl" class="MsoNormal"><span style="font-size: 10pt; font-family: &quot;Courier New&quot;"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>This outputs on passes that are neither first nor last.</span></p>  <p dir="rtl" class="MsoNormal"><span style="font-size: 10pt; font-family: &quot;Courier New&quot;"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>&lt;/TMPL_IF&gt;</span></p>  <p dir="rtl" class="MsoNormal"><span style="font-size: 10pt; font-family: &quot;Courier New&quot;">&nbsp;</span></p>  <p dir="rtl" class="MsoNormal"><span style="font-size: 10pt; font-family: &quot;Courier New&quot;"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>&lt;TMPL_IF __LAST__&gt;</span></p>  <p dir="rtl" class="MsoNormal"><span style="font-size: 10pt; font-family: &quot;Courier New&quot;"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>This only outputs on the last pass.</span></p>  <p dir="rtl" class="MsoNormal"><span style="font-size: 10pt; font-family: &quot;Courier New&quot;"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>&lt;TMPL_IF&gt;</span></p>  <p dir="rtl" class="MsoNormal"><span style="font-size: 10pt; font-family: &quot;Courier New&quot;">&nbsp;</span></p>  <p dir="rtl" class="MsoNormal"><span style="font-size: 10pt; font-family: &quot;Courier New&quot;"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Loop number: &lt;TMPL_VAR __COUNTER__&gt;</span></p>  <p dir="rtl" class="MsoNormal"><span style="font-size: 10pt; font-family: &quot;Courier New&quot;"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>This keeps track of how many times you have gone through the loop.</span></p>  <p dir="rtl" class="MsoNormal"><span style="font-size: 10pt; font-family: &quot;Courier New&quot;"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>&lt;TMPL_IF&gt;</span></p>  <p dir="rtl" class="MsoNormal"><span style="font-size: 10pt; font-family: &quot;Courier New&quot;"><span>&nbsp;&nbsp; </span>&lt;/TMPL_LOOP&gt;</span><span style="font-size: 10pt; font-family: &quot;Courier New&quot;"></span></p>  <p dir="rtl" class="MsoNormal"><span style="font-size: 10pt; font-family: &quot;Courier New&quot;">&nbsp;</span></p>  <p dir="rtl" class="MsoNormal"><span>ملاحظة: يقوم هذا توثيق لغى نماذج ويب جوي الاعتيادية, </span><em><span>HTML::Template</span><span>, </span></em><span>اذا تم ضبط نوع النموذج على لغى اخرى, يجب ان تنظر الى التوثيق من اجل ذلك.</span></p>  <p dir="rtl" class="MsoNormal"><span>بعض الامثلة تم استعارتها من توثيق </span><em><span>HTML::Template</span></em><span style="font-size: 10pt; font-family: &quot;Courier New&quot;"></span></p>  |,
		lastUpdated => 1178386684
	},

