	'639' => {
		message => q|  <p dir="rtl" class="MsoNormal"><span>تسمح لك النماذج بتخصيص منظر واحساس المحتوى الخاص بك على موقعك. ياتي الويب جوي بالعديد من النماذج التي من الممكن ان تستخدمها أو ان تنسخها وتعدلها لكي تتوافق مع متطلباتك الخاصة. لاحظ انه في العديد من الحالات من الممكن ان تغير منظر نماذج ويب جوي الاعتيادية من خلال </span><span>CSS</span><span>. ميزة هذا ان النماذج الاعتيادية يتم تحديثها اوتوماتيكيا عندما تحدث نسخة ويب جوي, بينما يجب ان يتم تحديث النماذج المخصصة يدويا. </span></p>  <p dir="rtl" class="MsoNormal"><span>&nbsp;</span></p>  <p dir="rtl" class="MsoNormal"><span>يوجد طريقتين لتعديل النماذج, من خلال شريط العرض لشاشة تعديل الاصل أو من خلال مدير الاصل. في أي من الحالات, ستحتاج ان تكون مديرا أو مدير نموذج. </span></p>  <p dir="rtl" class="MsoNormal"><span>&nbsp;</span></p>  <p dir="rtl" class="MsoNormal"><strong><span>نافذة العرض لشاشة تعديل الاصل</span></strong></p>  <p dir="rtl" class="MsoNormal"><span>شغل نظام الادارة</span></p>  <p dir="rtl" class="MsoNormal"><span>انقر على ايقونة التعديل للاصل</span></p>  <p dir="rtl" class="MsoNormal"><span>اختر نافذة العرض للاصل</span></p>  <p dir="rtl" class="MsoNormal"><span>بجانب النموذج الذي يستخدمه الاصل سيكون هناك ايقونتين.</span></p>  <p dir="rtl" class="MsoNormal"><span>&nbsp;</span></p>  <p dir="rtl" class="MsoNormal"><span>عدل:</span></p>  <p dir="rtl" class="MsoNormal"><span>سيسمح لك هذا بتعديل النموذج الذي اخترته حاليا</span></p>  <p dir="rtl" class="MsoNormal"><span>ادر:</span></p>  <p dir="rtl" class="MsoNormal"><span>سياخذك هذا إلى المجلد في مدير الاصول الذي يحتوي على هذا النموذج</span></p>  <p dir="rtl" class="MsoNormal"><span>&nbsp;</span></p>  <p dir="rtl" class="MsoNormal"><strong><span>مدير الاصول</span></strong></p>  <p dir="rtl" class="MsoNormal"><span>شغل نظام الادارة</span></p>  <p dir="rtl" class="MsoNormal"><span>انقر على ايقونة الصل في شريط الادارة</span></p>  <p dir="rtl" class="MsoNormal"><span>في شك تصفح </span><span>crumb trail</span><span> انقر على &quot;جذر&quot;</span></p>  <p dir="rtl" class="MsoNormal"><span>ثم انقر على الاصل المسمى &quot;</span><span> </span><span>Import Node</span><span>&quot;</span></p>  <p dir="rtl" class="MsoNormal"><span>اغلب نماذج ويب جوي الاعتيادية تخزن بالنوع في مجلدات داخل مجلد النماذج. </span></p>  <p dir="rtl" class="MsoNormal"><span>&nbsp;</span></p>  <p dir="rtl" class="MsoNormal"><strong><span>اسم النموذج</span></strong></p>  <p dir="rtl" class="MsoNormal"><span>اعطي لهذا النموذج اسم شرحي حتى تتعرف على ما هو عندما تضع النموذج على المادة.</span></p>  <p dir="rtl" class="MsoNormal"><span>&nbsp;</span></p>  <p dir="rtl" class="MsoNormal"><span>ملاحظة: لا يجب ابدا ان تعدل نمذج اعتيادي يأتي مع الويب جوي لانها رهن التغير مع كل اصدار جديد. بدلا من ذلك, انسخ النموذج الذي ترغب في تعديله وقم بتعديل النسخة.</span></p>  |,
